import React from 'react';
import { Link } from 'react-router-dom';
import './sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <Link to="/dashboard" className="sidebar-item">
        Dashboard
      </Link>
      <Link to="/apikeys" className="sidebar-item">
        API Keys
      </Link>
      <Link to="/sdks" className="sidebar-item">
        SDKs
      </Link>
      <Link to="/deployments" className="sidebar-item">
        Deployments
      </Link>
      <Link to="/wizard" className="sidebar-item">
        Wizard
      </Link>
    </div>
  );
};

export default Sidebar;
